import mongoose, { Types } from "mongoose";
import { type } from "os";

const productSchema = new mongoose.Schema({
  name: {
    type: String,
    required: true
  },
  price: {
    type: Number,
    required: true
  },
  description: {
    type: String,
    required: true
  },
  image: {
    type: String,
    required: true
  },
  brand: {
    type: String,
    required: true
  },
  category: {
    type: String,
    enum:["Electronics", "Mobile", "Car"],
    required: true
  },
  countInStock: {
    type: Number,
    required: true
  },
  id:{
    type: String, 
    required: true
  }
});

const Product = mongoose.model('Product', productSchema);
export default Product;


